// Get guest email from webhook
const guestEmail = $('TimeRex Webhook').first().json.body.event.form.find(
  f => f.field_type === 'guest_email'
)?.value || '';

const guestName = $('TimeRex Webhook').first().json.body.event.form.find(
  f => f.field_type === 'guest_name'
)?.value || '';

const calendarName = $('TimeRex Webhook').first().json.body.calendar_name || '';
const mediaSource = $('Detect Media Source').first().json.calendar_name || '';

// Extract domain and estimate company name
const domain = guestEmail.split('@')[1] || '';
let companyName = '';

if (domain) {
  // Remove common email providers
  const freeEmailDomains = ['gmail.com', 'yahoo.co.jp', 'yahoo.com', 'hotmail.com', 'outlook.com', 'icloud.com', 'me.com'];

  if (!freeEmailDomains.includes(domain.toLowerCase())) {
    // Extract company name from domain
    companyName = domain.split('.')[0];
    // Capitalize first letter
    companyName = companyName.charAt(0).toUpperCase() + companyName.slice(1);
  } else {
    companyName = 'Individual';
  }
}

return {
  guest_email: guestEmail,
  guest_name: guestName,
  email_domain: domain,
  company_name: companyName,
  calendar_name: calendarName,
  media_source: mediaSource,
  booking_date: $('TimeRex Webhook').first().json.body.event.local_start_datetime,
  host_name: $('TimeRex Webhook').first().json.body.event.hosts[0]?.name || '',
  meeting_url: $('TimeRex Webhook').first().json.body.event.google_meet_meeting?.join_url || '',
  event_id: $('TimeRex Webhook').first().json.body.event.id
};

